export default {
  id: "cockpit.xkcd",
  pluginPoint: "cockpit.dashboard",
  priority: 1,
  render: (container) => {
  	let img = document.createElement("img");
  	img.style = "padding-right: 1em; padding-left: 1em";
 
  	let nextBt = document.createElement("button");
  	nextBt.textContent = "»"
  	nextBt.addEventListener("click", () => {
  		updateXKCDImg(img, currentComic-1);
  	});

  	let backBt = document.createElement("button");
  	backBt.textContent = "«"
  	backBt.addEventListener("click", () => {
  		updateXKCDImg(img, currentComic+1);
  	});

  	let h3 = document.createElement("h3");
  	h3.textContent = 'XKCD';

  	let center = document.createElement("center");

	center.appendChild(h3);
  	center.appendChild(backBt);
	center.appendChild(img);
	center.appendChild(nextBt);

	container.appendChild(center);


	updateXKCDImg(img, currentComic);
  }
};

let currentComic = "latest";

function updateXKCDImg(img, comicId) {
	let oldSrc = img.src;
	let oldTitle = img.title;

	img.src = "data:image/gif;base64,";
	img.title = "Loading...";
	fetch("https://xkcd.vercel.app/?comic="+comicId)
  		.then(response => response.json())
  		.then(comic => {
  			currentComic = comic.num;
  			img.src = comic.img;
  			img.title = comic.alt;
  		})
  		.catch((error) => {
			img.src = oldSrc;
			img.title = oldTitle;
		});
}